import './App.css';
import Inicio from './Paginas/Inicio.jsx'
import Pagina1 from './Paginas/Pagina1'
import Pagina2 from './Paginas/Pagina2'
import Pagina3 from './Paginas/Pagina3'

import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Barradenavegacion from './Componentes/Barranavegacion.jsx';

function App() {
    return (
        <div>
            <BrowserRouter>
                <Barradenavegacion />
                <Routes>
                    <Route exact path="/" element={<Inicio />} />
                    <Route exact path="/Pagina1" element={<Pagina1 />} />
                    <Route exact path="/Pagina2" element={<Pagina2 />} />
                    <Route exact path="/Pagina3" element={<Pagina3 />} />

                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
